import React from "react";

import classes from "./ProfileImageInfo.module.css";



const ProfileImageInfo = (props) =>{





return (

<div className={classes.profileImageInfo}>


                 <div className={classes.nameDiv}>
                                           <i className={classes.name_i}><h2>{props.data.usertitle}  {props.data.firstname}   {props.data.lastname} </h2> </i>
                 </div>

	         <div className={classes.profileImageInfo_position}> <span>Role </span> <i> <span>Teacher</span> </i> </div>
                 <div className={classes.profileImageInfo_status}>  <span>Status</span>  <i>active</i> </div>
                 <div className={classes.profileImageInfo_joiningDate}> <span>Joined Since </span> <i>NotAvailable</i>  </div>








</div>
);

}

export default ProfileImageInfo;
